function ReportDashboard() {
    const [reps, setReps] = useState([{
        state: '',
        type: '',
        message: ''
    }])

    useEffect(() => {
        fetch("/reportdashboard")
            .then(res => {
                if (res.ok) {
                    console.log(res)
                    return res.json()
                }
            }).then(jsonRes =>
                setReps(jsonRes));
    })

    return <div className="container">
        <h2>Report Dashboard</h2>

        {/* {reps.map(rep =>
            <div>
                <h3>{rep.state}</h3>
                <p>{rep.type}</p>
                <p>{rep.message}</p>
            </div>
        )} */}
    </div>
}

